import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Dummy = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8081/eventarchive/dummy')
      .then(response => {
        console.log("Value:", response.data);
        setData(response.data || []); // Use an empty array if response.data is null or undefined
      })
      .catch(error => {
        console.error('Error fetching data:', error);
        setData([]); // Set data to an empty array in case of an error
      });
  }, []);

  return (
    <>
      <div>
        <h1>MySQL Table Data</h1>
        <table border="1">
          <thead>
            <tr>
              <th>Event Name</th>
              <th>Club</th>
              <th>Start Date</th>
              <th>Start Time</th>
              <th>End Date</th>
              <th>End Time</th>
              <th>Venue</th>
              <th>No. of registrations</th>
            </tr>
          </thead>
          <tbody>
            {data.map((row) => (
              <tr key={row.id}>
                <td>{row.event_name}</td>
                <td>{row.club}</td>
                <td>{row.start_date}</td>
                <td>{row.start_time}</td>
                <td>{row.end_date}</td>
                <td>{row.end_time}</td>
                <td>{row.venue}</td>
                <td>{row.No_of_Participants}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
};

export default Dummy;

